import React from "react";
import { Container } from "react-bootstrap";
import { useQuery } from "react-query";
import { API } from "../config/api";

const PaymentApprove = () => {
  const idUser = localStorage.getItem("idUser");
  let { data: users } = useQuery("usersCache", async () => {
    const response = await API.get("/users/" + idUser);
    return response.data.data;
  });
  let { data: transaction } = useQuery("transactionCache", async () => {
    const response = await API.get("/transaction");
    return response.data.data;
  });
  // console.log(idUser);
  // console.log(users);
  // console.log(transaction);
  return (
    <div>
      {transaction?.map((data) => {
        if (data?.status == "success" && data?.user.id == idUser) {
          console.log(data.trip.title);
        }
        if (data?.status == "success" && data?.user.id == idUser) {
          <Container
            className="border border-0 rounded-1 p-5"
            style={{ backgroundColor: "white", marginTop: "66px" }}
          >
            <h1>data?.trip?.title?</h1>
          </Container>;
        }
      })}
    </div>
  );
};

export default PaymentApprove;
